import React, { Component } from 'react';

class Product extends Component {
  render() {
    const {imageUrl, offerText, brandName, productName, price, mrf, quantity} = this.props.product;
    return (
      <div style={{display: "inline-flex"}}>
        <div style={{width: 300, height: 150, display: "inline-block"}}>
          <img style={{width: "100%", height: "100%"}} src={imageUrl} alt="product" />
          <span>{offerText} OFF</span>
        </div>
        <div style={{width: 300, height: 150, display: "inline-block"}}>
          <div>{brandName}</div>
          <div>{productName}</div>
          <div>{quantity}</div>
          <div>{price}</div>
          <div>{mrf}</div>
        </div>
        <div style={{width: 300, height: 150, display: "inline-block"}}>Block3 </div>
      </div>
    );
  }
}

export default Product;
